"33548" : {
"id":33548,
"typeIconPath":"data/icons/ArchiMate/BusinessProcess.png",
"data" : [
{
"lang":"nl",
"name":"Toewijzen Wmo ondersteuning",
"type":"Bedrijfsproces",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Met de toewijzing geeft de gemeente een aanbieder opdracht tot levering van zorg of ondersteuning voor een specifieke client. Het geeft de aanbieder het recht om de zorg te gaan leveren en is daarmee &#233;&#233;n van de rechtmatigheidsberichten. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">In het bericht wordt het toegewezen product omschreven. Dit toegewezen product kan aspecifiek zijn (dat wil zeggen dat alleen een productcategorie wordt toegewezen) of specifiek (dat wil zeggen dat binnen de productcategorie ook een specifieke productcode wordt toegewezen) of generiek (dat wil zeggen dat er geen productcategorie en ook geen productcode wordt toegewezen, maar alleen een budget).&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Wijzigen van een Toewijzing</b>&nbsp;<p style=\"margin-top: 3pt;\">Nadat de toewijzing is toegekend en ontvangen door de aanbieder kunnen er diverse redenen zijn om de toewijzing te wijzigen. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Indien de wijziging geconstateerd wordt door de gemeente (bv overlijden of overgang naar pgb), wordt er door de gemeente een gewijzigde toewijzing gestuurd. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Indien de wijziging ontstaat bij de behandeling van de client, zal de aanbieder een Verzoek om wijziging sturen aan de gemeente. Daarin kunnen verschillende situaties worden aangevraagd:&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">* Verlengen van een toewijzing&nbsp;<p style=\"margin-top: 3pt;\">* Verkorten van een toewijzing&nbsp;<p style=\"margin-top: 3pt;\">* Wijzigen van het volume&nbsp;<p style=\"margin-top: 3pt;\">* Wijzigen van het budget&nbsp;<p style=\"margin-top: 3pt;\">* Aanvragen nieuw product.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De gemeenten zal als gevolg van de Verzoek om wijziging binnen 5 werkdagen een Antwoordbericht of een toewijzing sturen. Nadat de gemeente akkoord is met het verzoek om wijziging, zal de gehele aangevraagde situatie worden toegekend.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Behalve de wijziging zelf (nieuwe einddatum) wordt in het bericht met de intrekking van de toewijzing ook meegegeven wat de reden van de wijziging is. Hiervoor is een speciale tabel beschikbaar waaruit de reden gekozen kan worden (codelijst Reden wijziging toewijzing, WMO002). Zie voor meer informatie de casu&#239;stiek.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Corrigeren van een Toewijzing</b>&nbsp;<p style=\"margin-top: 3pt;\">Wanneer een afgegeven Toewijzing gecorrigeerd moet worden, bijvoorbeeld omdat een verkeerd Product is toegewezen, wordt dit doorgegeven als een Intrekking. Hierin wordt als RedenWijziging &quot;01 (Administratieve correctie)&quot; meegegeven en is de einddatum gelijk aan de ingangsdatum van de eerdere Toewijzing. De eerdere Toewijzing moet als 'niet verzonden' beschouwd worden. De gecorrigeerde Toewijzing kan met een nieuw ToewijzingNummer in hetzelfde bericht worden meegegeven. Deze toewijzing dient een ingangsdatum te hebben welke 1 dag later ligt dan de eerdere toewijzing. &nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
