"33523" : {
"id":33523,
"typeIconPath":"data/icons/ArchiMate/BusinessProcess.png",
"data" : [
{
"lang":"nl",
"name":"Aanleveren declaratie",
"type":"Bedrijfsproces",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De aanbieder declareert in het berichtenverkeer de geleverde producten in overeenstemming met de toegewezen producten. De declaratieberichten zijn onderdeel van de rechtmatigheidsberichten.&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Retourinformatie declaratie</b>&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt;\">De gemeente beantwoordt een declaratiebericht binnen 10 werkdagen na ontvangst met een declaratie-antwoordbericht. &nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"><i>Retourinformatie declaratie</i>&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt;\">In het declaratie-antwoordbericht wordt aangegeven welke prestaties zijn afgewezen. Het totaalbedrag dat toegekend &nbsp;wordt, wordt berekend op basis van de toegekende prestaties. De afgewezen prestaties kunnen door de aanbieder in een nieuw declaratiebericht gecorrigeerd worden aangeleverd.<i></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span></i>"}}]
}
]
}
