"33592" : {
"id":33592,
"typeIconPath":"data/icons/ArchiMate/BusinessProcess.png",
"data" : [
{
"lang":"nl",
"name":"Intrekken Wmo ondersteuning",
"type":"Bedrijfsproces",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De gemeente kan een eerder afgegeven toewijzing intrekken, daarmee wordt de opdracht tot levering van een Wmo-product voor een specifieke client voor die aanbieder beeindigd. De intrekking bevat dezelfde gegevens als de toewijzing, maar nu met de einddatum ingevuld of met een einddatum die ligt v&#243;&#243;r de einddatum van de eerder verzonden toewijzing. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De gemeente kan een toewijzing bijvoorbeeld intrekken wanneer bij een nieuwe beoordeling wordt vastgesteld dat een client de eerder toegewezen zorg of ondersteuning niet meer nodig heeft. De toewijzing krijgt dan een (nieuwe) einddatum. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Ook kan het voorkomen dat de client de zorg of ondersteuning bij een andere aanbieder gaat voortzetten. Dan krijgt alleen de toewijzing (toegewezen product) een (nieuwe) einddatum.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Behalve de wijziging zelf (nieuwe einddatum) wordt ook meegegeven wat de reden van de wijziging is. Hiervoor is een speciale tabel beschikbaar waaruit de reden gekozen kan worden (codelijst Reden wijziging toewijzing, WMO002). De redenen van wijziging zijn hieronder nader toegelicht. Zie voor meer informatie de casuistiek. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Administratieve correctie &nbsp;<p style=\"margin-top: 3pt;\"></b>Gemeente ontdekt dat de toewijzing foutief was en gecorrigeerd moet worden. &nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Client overleden &nbsp;<p style=\"margin-top: 3pt;\"></b>De toewijzing moet worden gestopt, omdat de client is overleden. &nbsp;<p style=\"margin-top: 3pt;\">Over het algemeen zal dan worden gevuld: einddatum toewijzing = overlijdensdatum client. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Contractwijziging &nbsp;<p style=\"margin-top: 3pt;\"></b>Gemeente maakt een nieuwe contractafspraak met aanbieder, waardoor toewijzing nodig is met ander bijvoorbeeld andere productcodes. NB: niet elke contractwijziging zal leiden tot een nieuwe toewijzing. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Herbeoordeling: verlenging toewijzing&nbsp;<p style=\"margin-top: 3pt;\"></b>Als gevolg van een herbeoordeling kan een toewijzing verlengd worden. Als de zorg verlengd wordt, dan kan eventueel gebruik gemaakt worden van dezelfde toewijzing.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Herbeoordeling: verkorting toewijzing&nbsp;<p style=\"margin-top: 3pt;\"></b>In verschillende situaties zal de huidige toewijzing ingetrokken moeten worden: &nbsp;<p style=\"margin-top: 3pt;\">a.&nbsp;&nbsp;&nbsp;&nbsp;Client moet ander product toegewezen krijgen. &nbsp;<p style=\"margin-top: 3pt;\">b.&nbsp;&nbsp;&nbsp;&nbsp;Client moet korter zorg krijgen. &nbsp;<p style=\"margin-top: 3pt;\">c.&nbsp;&nbsp;&nbsp;&nbsp;Client moet andere omvang krijgen, bijvoorbeeld meer uren per week, tenzij het een toewijzing in budget of totaal per toewijzing periode betreft&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Uitstroom naar ander domein &nbsp;<p style=\"margin-top: 3pt;\"></b>Client gaat over naar ander domein, bijvoorbeeld naar Wlz, en daarom eindigt de Wmo toewijzing. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Verhuizing naar een andere gemeente &nbsp;<p style=\"margin-top: 3pt;\"></b>Wanneer de client verhuist naar een andere gemeente, wordt de nieuwe gemeente verantwoordelijk voor de Wmo-ondersteuning aan de client. De oude gemeente kan de afgegeven Toewijzing intrekken. In het belang van de client kan het noodzakelijk zijn dat gemeente en aanbieder onderling afstemmen wanneer de toewijzing wordt ingetrokken en wanneer een eventuele nieuwe toewijzing volgt van de nieuwe gemeente. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Wijziging leveringsvorm &nbsp;<p style=\"margin-top: 3pt;\"></b>Client gaat gebruik maken van pgb. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Overstap naar andere aanbieder &nbsp;<p style=\"margin-top: 3pt;\"></b>Client gaat naar een andere aanbieder, dus de toewijzing bij deze aanbieder moet beeindigd worden. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Overgang naar nieuwe bekostigingssystematiek &nbsp;<p style=\"margin-top: 3pt;\"></b>De toewijzing is ingetrokken, omdat de client is overgegaan naar een andere regeling/bekostiging. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Gemeentelijke herindeling &nbsp;<p style=\"margin-top: 3pt;\"></b>Volgens protocol gemeentelijke herindeling is deze toewijzing niet meer geldig.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Geinitieerd door de aanbieder&nbsp;<p style=\"margin-top: 3pt;\"></b>Indien een toewijzing wijzigt als gevolg van een verzoek om wijziging, kan dit door de gemeente worden aangegeven middels deze code. Het is dan voor de aanbieder duidelijk op basis waarvan de wijziging is doorgevoerd. &nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
