"28117" : {
"id":28117,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV063: Hoe moet ProductPeriode gevuld worden wanneer methode \"som over declaratie/factuurperiode\" gebruikt wordt?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Voor een product volgt precies &#233;&#233;n Prestatie per declaratie-/factuurperiode, ongeacht het aantal hulpperiodes dat binnen de declaratie-/factuurperiode ligt.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De ProductPeriode Begindatum wordt gevuld met:&nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>de DeclaratiePeriode Begindatum van de declaratie-/factuurperiode indien de Ingangsdatum van het ToegewezenProduct voor of op de DeclaratiePeriode Begindatum ligt.</li><li>de Ingangsdatum van het ToegewezenProduct indien de Ingangsdatum ToegewezenProduct na de DeclaratiePeriode Begindatum ligt.</ul>&nbsp;<p style=\"margin-top: 3pt;\">De ProductPeriode Einddatum wordt gevuld met:&nbsp;<p style=\"margin-top: 3pt;\"></li><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>de DeclaratiePeriode Einddatum van de declaratie-/factuurperiode indien de Einddatum van het ToegewezenProduct op of na de DeclaratiePeriode Einddatum ligt.</li><li>de Einddatum van het ToegewezenProduct indien de Einddatum ToegewezenProduct voor de DeclaratiePeriode Einddatum ligt.</ul><b>&nbsp;<p style=\"margin-top: 3pt;\">Facturatie/Declaratie systematiek&nbsp;<p style=\"margin-top: 3pt;\"></b>Gemeenten en aanbieders kunnen (op grond van OP264) onderling afwijkende afspraken maken over de momenten waarop, al dan niet in delen, gedeclareerd of gefactureerd kan worden, in de situatie van een outputgericht product dat in euro's is toegewezen.&nbsp;<p style=\"margin-top: 3pt;\">Als het resultaat van een hulpperiode voor een outputgericht product pas aan het eind van die hulpperiode kan worden vastgesteld, wordt de productperiode gelijk gesteld aan de declaratie-/factuurperiode waarin het resultaat is vastgesteld tenzij de gemeente en aanbieder afwijkende afspraken hebben gemaakt over het aantal declaratie momenten. Hierbij wordt de ProductPeriode indien nodig aangepast zodat de productperiode ook in deze situatie altijd binnen de periode van de toewijzing valt.&nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Voorbeelden&nbsp;<p style=\"margin-top: 3pt;\"></b>In onderstaande voorbeelden wordt uitgegaan van de volgende situatie:&nbsp;<p style=\"margin-top: 3pt;\"></li><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Er wordt per maand gedeclareerd/gefactureerd</li><li>Het ToegewezenProduct heeft Ingangsdatum 11-04-2019 en Einddatum 18-06-2019 (dit is de toegewezen periode)</li><li>In de voorbeelden staan de ProductPeriodes in de declaratie/factuur voor de maanden April, Mei en Juni benoemd</ul>&nbsp;<p style=\"margin-top: 3pt;\">1: Ononderbroken hulpperiode&nbsp;<p style=\"margin-top: 3pt;\">Client ontvangt vanaf het begin t/m het eind van de toegewezen periode ononderbroken hulp. Er volgt per maand &#233;&#233;n Prestatie met de volgende ProductPeriodes:&nbsp;<p style=\"margin-top: 3pt;\">April: 11-04-2019 t/m 30-04-2019&nbsp;<p style=\"margin-top: 3pt;\">Mei: 01-05-2019 t/m 31-05-2019&nbsp;<p style=\"margin-top: 3pt;\">Juni: 01-06-2019 t/m 18-06-2019&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">2: Onderbroken hulpperiode&nbsp;<p style=\"margin-top: 3pt;\">Client ontvangt onderbroken hulp in de volgende periodes:&nbsp;<p style=\"margin-top: 3pt;\">- 12-04-2019 t/m 15-04-2019&nbsp;<p style=\"margin-top: 3pt;\">- 23-04-2019 t/m 08-05-2019&nbsp;<p style=\"margin-top: 3pt;\">- 13-05-2019 t/m 20-05-2019&nbsp;<p style=\"margin-top: 3pt;\">- 03-06-2019 t/m 07-06-2019&nbsp;<p style=\"margin-top: 3pt;\">- 11-06-2019 t/m 17-06-2019&nbsp;<p style=\"margin-top: 3pt;\">Er volgt per maand &#233;&#233;n Prestatie met de volgende ProductPeriodes:&nbsp;<p style=\"margin-top: 3pt;\">April: 11-04-2019 t/m 30-04-2019&nbsp;<p style=\"margin-top: 3pt;\">Mei: 01-05-2019 t/m 31-05-2019&nbsp;<p style=\"margin-top: 3pt;\">Juni: 01-06-2019 t/m 18-06-2019&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">3: Outputgericht met resultaat op eind van hulpperiode&nbsp;<p style=\"margin-top: 3pt;\">Client ontvangt onderbroken of ononderbroken outputgerichte hulp vanaf het begin tot het eind van toegewezen periode (11-04-2019 t/m 18-06-2019). Pas op 18-06-2019 kan het resultaat van de outputgerichte hulp worden vastgesteld. In de maanden April en Mei wordt er geen declaratie/factuur ingediend voor deze client. Er volgt in de maand juni &#233;&#233;n Prestatie met de volgende ProductPeriode:&nbsp;<p style=\"margin-top: 3pt;\">Juni: 01-06-2019 t/m 18-06-2019<span style=\" font-family: Arial;\"></span><span style=\" font-size: 9pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span></li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO303","id":28222,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW303","id":29743,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV063"}}}]
}
]
}
