"28109" : {
"id":28109,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV072: Hoe moet de declaratie/factuur gevuld worden wanneer sprake is van elkaar opvolgende toewijzingen binnen één declaratie-/factuurperiode?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Als sprake is van elkaar opvolgende ToegewezenProducten binnen een declaratie-/factuurperiode, dan volgen aparte Prestaties per ToegewezenProduct, per product in de declaratie/factuur over die declaratie-/factuurperiode. Dit geldt zowel voor de methode &quot;werkelijke productperiodes&quot; (zie IV062) als ook voor de methode &quot;som over declaratie-/factuurperiode&quot; (zie IV063). Een Prestatie kan dus nooit op meer dan &#233;&#233;n ToegewezenProduct betrekking hebben.&nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Voorbeeld&nbsp;<p style=\"margin-top: 3pt;\"></b>In onderstaande voorbeeld wordt uitgegaan van de volgende situatie:&nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Er wordt per maand gedeclareerd/gefactureerd</li><li>Het eerste ToegewezenProduct heeft Ingangsdatum 01-03-2019 en Einddatum 09-03-2019</li><li>Het opvolgende ToegewezenProduct heeft Ingangsdatum 23-03-2019 en Einddatum 31-03-2019</li><li>Er is ononderbroken zorg geleverd gedurende beide toegewezen periodes</ul>&nbsp;<p style=\"margin-top: 3pt;\">Er worden nu 2 Prestaties ingediend met de volgende ProductPeriodes:&nbsp;<p style=\"margin-top: 3pt;\">ProductPeriode Prestatie 1: 01-03-2018 t/m 09-03-2018&nbsp;<p style=\"margin-top: 3pt;\">ProductPeriode Prestatie 2: 23-03-2018 t/m 31-03-2018<span style=\" font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span></li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO303","id":28222,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW303","id":29743,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV072"}}}]
}
]
}
,
