"28081" : {
"id":28081,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV089: Hoe moet ProductPeriode gevuld worden?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Voor declareren zijn de volgende begrippen van belang:&nbsp;<p style=\"margin-top: 3pt;\">* Declaratieperiode: is een administratieve periode waarbinnen de geleverde hulp in de administratie tot een declaratie wordt verwerkt. Dit is altijd een kalendermaand. &nbsp;<p style=\"margin-top: 3pt;\">* Productperiode: is de begin- en einddatum van een geleverd product binnen een &nbsp;declaratieperiode. De productperiode valt altijd binnen de geldigheidsperiode van de toewijzing. De productperiode is clientgebonden en valt altijd binnen &#233;&#233;n declaratieperiode. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">In het declaratiebericht wordt het totale geleverde volume van 1 specifiek product binnen 1 productperiode aan 1 client (behorende bij 1 toewijzing) opgenomen in 1 Prestatie. Deze prestaties worden direct in de erop volgende declaratieperiode, of eventueel achteraf in een latere declaratieperiode, gedeclareerd. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De ProductPeriode Begindatum wordt gevuld met: &nbsp;<p style=\"margin-top: 3pt;\">* De DeclaratiePeriode Begindatum van de declaratieperiode indien de Ingangsdatum van het ToegewezenProduct voor of op de DeclaratiePeriode Begindatum ligt. * De Ingangsdatum van het ToegewezenProduct indien de Ingangsdatum ToegewezenProduct na de DeclaratiePeriode Begindatum ligt.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De ProductPeriode Einddatum wordt gevuld met: &nbsp;<p style=\"margin-top: 3pt;\">* De DeclaratiePeriode Einddatum van de declaratieperiode indien de Einddatum van het ToegewezenProduct op of na de DeclaratiePeriode Einddatum ligt. &nbsp;<p style=\"margin-top: 3pt;\">* De Einddatum van het ToegewezenProduct indien de Einddatum ToegewezenProduct voor de DeclaratiePeriode Einddatum ligt.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Voorbeeld</b>&nbsp;<p style=\"margin-top: 3pt;\">In onderstaande voorbeeld wordt uitgegaan van de volgende situatie: &nbsp;<p style=\"margin-top: 3pt;\">Het ToegewezenProduct heeft Ingangsdatum 08-04-2021 en Einddatum 17-06-2021 (dit is de toegewezen periode)&nbsp;<p style=\"margin-top: 3pt;\">ProductPeriodes voor de maanden April, Mei en Juni zijn dan:&nbsp;<p style=\"margin-top: 3pt;\">* April: 08-04-2021 t/m 30-04-2021 &nbsp;<p style=\"margin-top: 3pt;\">* Mei: 01-05-2021 t/m 31-05-2021 &nbsp;<p style=\"margin-top: 3pt;\">* Juni: 01-06-2021 t/m 17-06-2021&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Trajectfinanciering </b>&nbsp;<p style=\"margin-top: 3pt;\">Gemeenten en aanbieders kunnen (op grond van OP264) onderling afwijkende afspraken maken over de momenten waarop, al dan niet in delen, gedeclareerd &nbsp;kan worden, in de situatie van een outputgericht product dat in euro's is toegewezen. &nbsp;<p style=\"margin-top: 3pt;\">Als het resultaat pas aan het eind van het traject kan worden vastgesteld, wordt de productperiode gelijk gesteld aan de declaratieperiode waarin het resultaat is vastgesteld. Gemeente en aanbieder kunnen ook afwijkende afspraken hebben gemaakt over het aantal declaratie momenten. Hierbij wordt de ProductPeriode indien nodig aangepast zodat de productperiode ook in deze situatie altijd binnen de periode van de toewijzing valt. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Voorbeeld</b>&nbsp;<p style=\"margin-top: 3pt;\">Afspraak is dat op het eind van het traject de declaratie mag worden ingediend.&nbsp;<p style=\"margin-top: 3pt;\">Client ontvangt outputgerichte hulp vanaf het begin tot het eind van toegewezen periode (08-04-2021 t/m 17-06-2021). Pas op 17-06-2021 kan het resultaat van de outputgerichte hulp worden vastgesteld. In de maanden April en Mei wordt er geen</span><span style=\" font-size: 10pt;\"> </span><span style=\" font-size: 10pt;\">declaratie ingediend voor deze client. Er volgt in de maand juni 1 Prestatie met de volgende ProductPeriode: &nbsp;<p style=\"margin-top: 3pt;\">* Juni: 01-06-2021 t/m 17-06-2021 &nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO323","id":28554,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW323","id":29834,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV089"}}}]
}
]
}
