"28157" : {
"id":28157,
"typeIconPath":"data/icons/ArchiMate/MotivationConstraint.png",
"data" : [
{
"lang":"nl",
"name":"CS050: Als Partnernaam gevuld is, dan NaamGebruik vullen met waarde 1, 2, 3 of 4. Anders waarde 1 vullen.",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Als Partnernaam gevuld is, wordt in NaamGebruik aangegeven hoe de persoon zijn naam wenst te gebruiken. Hiervoor kunnen de volgende waarden gebruikt worden:&nbsp;<p style=\"margin-top: 3pt;\">1 (eigen naam), 2 (naam echtgenoot of geregistreerd partner of alternatieve naam), 3 (naam echtgenoot of geregistreerd partner gevolgd door eigen naam) of 4 (eigen naam gevolgd door naam echtgenoot of geregistreerd partner). Indien geen Partnernaam gevuld is, wordt verplicht 1 (eigen naam) gevuld.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"LDT_Retourcode-Wmo/Jw","id":30598,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Constraint":{"code":"CS050"}}}]
}
]
}
