"27990" : {
"id":27990,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV073: Hoe moet worden omgegaan met btw in een declaratie of factuur?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De soort zorg (product) bepaalt of een aanbieder btw moet afdragen. Als een aanbieder zorg verleent waarover btw moet worden afgedragen, dan is hij btw plichtig.&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\"><b>Wat is verschil tussen een factuur en een declaratie m.b.t. btw?</b>&nbsp;<p style=\"margin-top: 3pt;\">BtwIDNummer moet altijd gevuld worden als de hulpverlener btw-plichtig is. Per ingediende prestatie (dus per gedeclareerde/gefactureerde product) wordt aangegeven of de aanbieder voor dat product btw moet afdragen (BtwVrijstellingsIndicatie).&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Factuur</b>&nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Indien code bericht gevuld is met waarde 448 of 450 (= Factuur Wmo-ondersteuning of Factuur Jeugdhulp), dan moet indicatie BTW-vrijstelling voorkomen. (zie CD059)</li><li>Indien BtwVrijstellingIndicatie gevuld is met waarde 1 (Btw-vrijstelling), dan mogen BtwPercentage en BtwBedrag niet voorkomen. (zie CD056)</li><li>Indien BtwVrijstellingIndicatie gevuld is met waarde 2 (Geen Btw-vrijstelling), dan moeten BtwIDNummer, BtwTotaalBedrag, BtwPercentage en BtwBedrag voorkomen (zie CD055)</li><li>BtwIDNummer moet gevuld worden als de hulpverlener btw-plichtig is, ongeacht of er in het bestand wel of niet sprake is van gedeclareerde/gefactureerde hulp waar btw op van toepassing is.</ul>&nbsp;<p style=\"margin-top: 3pt;\"><b>Declaratie</b>&nbsp;<p style=\"margin-top: 3pt;\">In het geval van een declaratie zijn alle bedragen inclusief btw als over dat product btw afgedragen moet worden. &nbsp;<p style=\"margin-top: 3pt;\"></li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO303","id":28222,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW303","id":29743,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV073"}}}]
}
]
}
