"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 11pt;\">Een actueel startbericht is een startbericht waarbij nog geen stopbericht is verstuurd met dezelfde combinatie van sleutelvelden (gekoppeld via het toewijzingnummer) en dat niet is verwijderd d.m.v. een startbericht met status aanlevering verwijderen (zie IV008).&nbsp;<p style=\"margin-top: 3pt;\">De levering is dan nog niet gestopt, en er mag geen start gestuurd &nbsp;worden. Pas nadat er een stopbericht is gekomen kan er opnieuw een startbericht voor het toegewezen product (dezelfde combinatie van sleutelvelden) gestuurd worden. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 11pt; font-family: Arial;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO305","id":28387,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW305","id":29812,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_Retourcode-Wmo/Jw","id":30598,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR326","niveau":"berichtoverstijgend"}}}]
