"28412" : {
"id":28412,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV053: Wanneer kan een creditering van een declaratie of factuur verzonden worden?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Wanneer een eerd</span><span style=\" font-size: 10pt; font-family: Arial;\">er ingediende prestatie door de aanbieder onjuist is bevonden, kan deze door de aanbieder worden ingetrokken door aanlevering van een creditprestatie.&nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Credit op factuur&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt; font-family: Arial;\"></b></span><span style=\" font-size: 10pt;\">Met een creditering van een eerder ingediende prestatie wordt de vordering van de aanbieder op de gemeente opgeheven voor die betreffende prestatie.&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">Een aanbieder kan de volgende redenen hebben om een eerder ingediende prestatie te crediteren:&nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Aanbieder heeft een fout geconstateerd die hersteld wordt door de aanbieder. In dit geval kan de eerder ingediende prestatie worden gecrediteerd, waarna vervolgens een nieuwe (correcte) debet prestatie kan worden ingediend.</li><li>De gemeente heeft een prestatie afgewezen en de aanbieder is het eens met de (reden van) afwijzing. De aanbieder crediteert de afgewezen prestatie.</ul>Indien de gemeente het gehele factuurbericht heeft afgewezen (retourbericht met alleen een header met foutcode), mag de aanbieder geen creditfactuur sturen. De afgekeurde factuur is niet verwerkt door de gemeenten en er staat geen vordering open op basis van deze afgekeurde factuur.&nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Credit op declaratie&nbsp;<p style=\"margin-top: 3pt;\"></b>Een aanbieder kan een eerder ingediende prestatie crediteren. Dit kan alleen nadat er een retourbericht op de debetprestatie is ontvangen en de prestatie daarin niet is afgewezen. Een door de gemeente afgewezen prestatie wordt dus, bij gebruik van declareren, nooit gecrediteerd.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">NB: Voor zowel de factuur als de declaratie geldt dat een creditering een eenzijdige handeling van de aanbieder is, die niet bestreden kan worden door een gemeente. De gemeente kan een ingediende creditprestatie dus niet afwijzen, tenzij het technische afkeur (XSLT of XSD) betreft. Zie hiervoor invulinstructies IV032 en IV056).<span style=\" font-family: Arial;\"></span><span style=\" font-size: 9pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span></li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO303","id":28222,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW303","id":29743,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV053"}}}]
}
]
}
