"28473" : {
"id":28473,
"typeIconPath":"data/icons/ArchiMate/MotivationConstraint.png",
"data" : [
{
"lang":"nl",
"name":"TR322: Indien in het ToegewezenProduct een Omvang is meegegeven, moet de som van GeleverdVolume in alle ingediende Prestaties die betrekking hebben op dat ToegewezenProduct passen binnen de toegewezen Omvang.",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Hierbij moet rekening worden gehouden met de waarden van Eenheid, Frequentie en totale loopduur van het ToegewezenProduct enerzijds en de waarde van Eenheid en de duur van de DeclaratiePeriode in de ingediende Prestaties anderzijds. De som van het GeleverdVolume in alle ingediende Prestaties die betrekking hebben op dat ToegewezenProduct mag het maximale volume berekend over de loopduur van de toewijzing niet overstijgen.</span><span style=\" font-size: 10pt; font-family: Arial;\"></span><span style=\" font-size: 9pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO323","id":28554,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW323","id":29834,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"CDT_IngediendeBedragPrestatie","id":30584,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_Retourcode-Wmo/Jw","id":30598,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR322","niveau":"berichtoverstijgend"}}}]
}
]
}
