"28492" : {
"id":28492,
"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP257: Bij een wijziging van de zorgvraag wordt voor het betreffende product een nieuwe toewijzing afgegeven.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Bij een wijziging van de zorgvraag wordt voor het betreffende product een nieuwe toewijzing afgegeven of voor het betreffende product wordt een gewijzigde toewijzing gestuurd, zie ook OP033x1. &nbsp;<p style=\"margin-top: 3pt;\">Een eventueel bestaande toewijzing wordt beeindigd indien: &nbsp;<p style=\"margin-top: 3pt;\"> * De omvang van de te leveren ondersteuning wijzigt: er is meer of minder ondersteuning nodig op hetzelfde product dan vastgesteld in de bestaande toewijzing, behalve wanneer de omvang is gedefinieerd met een frequentie totaal binnen geldigheidsduur.&nbsp;<p style=\"margin-top: 3pt;\"> * Het product wijzigt: de client heeft recht op een ander product dan vastgesteld in de bestaande toewijzing.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Een eventueel bestaande toewijzing wordt aangepast indien: &nbsp;<p style=\"margin-top: 3pt;\"> * De einddatum van de te leveren zorg of ondersteuning wijzigt (intrekken of oprekken)&nbsp;<p style=\"margin-top: 3pt;\"> * Het volume wijzigt bij een frequentie &nbsp;totaal binnen geldigheidsduur toewijzing&nbsp;<p style=\"margin-top: 3pt;\"> * Het maximaal budget wordt gewijzigd&nbsp;<p style=\"margin-top: 3pt;\">Indien de gemeente het initiatief neemt tot aanpassing van het volume of het maximale budget , mag dit alleen in overleg met en na instemming van de aanbieder worden gedaan.&nbsp;<p style=\"margin-top: 3pt;\">"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO301","id":29618,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW301","id":29203,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP257","geen technische regels":false}}}]
}
]
}
