"28607" : {
"id":28607,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV090: Hoe moet het declaratiebericht gevuld worden indien achteraf gedeclareerd wordt?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Zorg of ondersteuning geleverd aan een client tijdens een bepaalde declaratieperiode wordt direct in de erop volgende declaratieperiode of achteraf in een latere declaratieperiode gedeclareerd. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Wanneer achteraf wordt gedeclareerd, mag dit niet met een declaratieperiode worden gedaan die voor de laatst ingediende declaratieperiode ligt. De productperiode zelf mag wel in het verleden liggen, aangezien hiermee de periode van levering wordt aangeduid &nbsp;<p style=\"margin-top: 3pt;\">Wanneer achteraf wordt gedeclareerd over meerdere declaratieperiodes worden in &#233;&#233;n declaratiebericht evenveel prestaties opgenomen als het aantal afzonderlijke prestaties dat verzonden zou zijn wanneer deze in afzonderlijke berichten waren opgenomen. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Voorbeelden </b>&nbsp;<p style=\"margin-top: 3pt;\">In onderstaande voorbeelden wordt uitgegaan van de volgende situatie: &nbsp;<p style=\"margin-top: 3pt;\">De volgende declaratieperiodes zijn ingediend:&nbsp;<p style=\"margin-top: 3pt;\">01-01-2021 t/m 31-01-2021&nbsp;<p style=\"margin-top: 3pt;\">01-02-2021 t/m 28-02-2021&nbsp;<p style=\"margin-top: 3pt;\">01-03-2021 t/m 31-03-2021 &nbsp;<p style=\"margin-top: 3pt;\">01-05-2021 t/m 31-05-2021 (In april was er blijkbaar niets te declareren) &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Achteraf declareren als een declaratieperiode mist</b> &nbsp;<p style=\"margin-top: 3pt;\">In juni blijkt dat in april 2021 toch iets te declareren was, aangezien in maart 2021 zorg is geleverd aan een Client. Aangezien er al een declaratieperiode is ingediend die na April 2021 ligt (namelijk mei 2021), kunnen de nog niet ingediende Prestaties van Maart 2021 worden ingediend met &#233;&#233;n van de volgende declaratieperiodes: &nbsp;<p style=\"margin-top: 3pt;\">* Als 2e declaratie van de maand mei: DeclaratiePeriode 01-05-2021 t/m 31-05-2021&nbsp;<p style=\"margin-top: 3pt;\">* Bij de eerstvolgende declaratie in juni: DeclaratiePeriode 01-06-2021 t/m 30-06-2021&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Achteraf declareren als de hulpperiode meerdere declaratieperiodes beslaat</b> &nbsp;<p style=\"margin-top: 3pt;\">In juni blijkt dat (ononderbroken) geleverde ondersteuning aan een cli&#235;nt tussen 15-02-2021 t/m 30-04-2021 nog niet is gedeclareerd. Er dient per declaratieperiode een Prestatie te worden ingediend. Er volgen in het volgende declaratiebericht 3 Prestaties met de volgende productperiodes: &nbsp;<p style=\"margin-top: 3pt;\">* ProductPeriode Prestatie 1: 15-02-2021 t/m 28-02-2021 &nbsp;<p style=\"margin-top: 3pt;\">* ProductPeriode Prestatie 2: 01-03-2021 t/m 31-03-2021&nbsp;<p style=\"margin-top: 3pt;\">* ProductPeriode Prestatie 3: 01-04-2021 t/m 30-04-2021 &nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO323","id":28554,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW323","id":29834,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV090"}}}]
}
]
}
