"28664" : {
"id":28664,
"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP033x1: Een afgegeven toewijzing mag gewijzigd worden waarbij de wijziging met een nieuw bericht moet worden doorgegeven.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De volgende wijzigingen in de einddatum zijn toegestaan: &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">* Intrekken: aanpassen van de gewenste einddatum toewijzing zodat de periode korter wordt (NB dit is alleen toegestaan in overleg met de aanbieder).&nbsp;<p style=\"margin-top: 3pt;\">* Oprekken: aanpassen van de gewenste einddatum toewijzing zodat de periode langer wordt (NB dit is alleen toegestaan in overleg met de aanbieder). &nbsp;<p style=\"margin-top: 3pt;\">* Corrigeren: de einddatum van de toewijzing wordt gewijzigd zodat deze gelijk is aan de ingangsdatum van de toewijzing. Daarbij wordt RedenWijziging gevuld met 01 (Administratieve correctie). Een administratieve correctie betekent dat de toewijzing als niet verzonden beschouwd moet worden.&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">De volgende wijzigingen in volume en maximaal budget zijn toegestaan: &nbsp;<p style=\"margin-top: 3pt;\">* Volume wijzigen: Als de omvang is gespecificeerd met in Frequentie de waarde &quot;Totaal binnen geldigheidsduur toewijzing&quot;, dan mag Volume worden aangepast. &nbsp;<p style=\"margin-top: 3pt;\">Indien dit op verzoek van de aanbieder (via een verzoek om wijziging) is, mag dit zonder overleg worden aangepast door de gemeente. &nbsp;<p style=\"margin-top: 3pt;\">Indien de gemeente het initiatief tot aanpassing van het volume neemt, mag dit alleen in overleg met en na instemming van de aanbieder worden aangepast.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">* Budget wijzigen: Als Budget op verzoek van de aanbieder (via een verzoek om wijziging) wordt gewijzigd, mag dit zonder overleg worden aangepast door de gemeente. &nbsp;&nbsp;&nbsp;<p style=\"margin-top: 3pt;\">Indien de gemeente het initiatief tot aanpassing van het maximale budget neemt, mag dit alleen in overleg met en na instemming van de aanbieder worden aangepast.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De meest recente toewijzing op toewijzingsdatum en -tijd is bepalend voor de inhoud van de toewijzing&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO301","id":29618,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW301","id":29203,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP033x1"}}}]
}
]
}
