"28743" : {
"id":28743,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV056: Hoe wordt een retourbericht op een declaratie- of factuurbericht opgesteld?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Een retourbericht op een declaratie- of factuurbericht wordt gestuurd om de aanbieder te informeren over de beoordeling (technisch/inhoudelijk) van het bericht. Daarnaast wordt de aanbieder geinformeerd over het totaalbedrag dat door de gemeente wordt toegekend op de declaratie of factuur. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Voor ieder verzonden declaratie- of factuurbericht wordt slechts &#233;&#233;n retourbericht gestuurd (&#233;&#233;n-op-&#233;&#233;n). De gemeente stuurt altijd een retourbericht naar de aanbieder. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Bij afkeur op de technische controle (niveau 1 en 2, zie IV032) wordt na aanpassing van de fouten een nieuw bericht ingediend. Het afgekeurde bericht is niet verwerkt en ingediende prestaties dienen in dit geval dus niet te worden gecrediteerd (in geval van factureren, bij declareren is crediteren van afgewezen regels sowieso niet nodig).</li><li>Bij afkeur op de inhoudelijke controle (niveau 3 en 4) worden de afgewezen prestaties, na aanpassing van de fouten in een volgende declaratie of factuur verstuurd. </ul>&nbsp;<p style=\"margin-top: 3pt;\">De vulling van het retourbericht is afhankelijk van de situatie en de geconstateerde fouten: &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">1.&nbsp;&nbsp;&nbsp;&nbsp;Het bericht is volledig goedgekeurd:&nbsp;<p style=\"margin-top: 3pt;\">Alleen de header wordt retour gestuurd. Retourcode 8001 (Declaratie is volledig toegewezen) wordt meegegeven en het uiteindelijke toegekende totaalbedrag wordt vermeld. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">2.&nbsp;&nbsp;&nbsp;&nbsp;Het bericht is volledig afgekeurd:&nbsp;<p style=\"margin-top: 3pt;\">Alleen de header wordt retour gestuurd. Het toegekende totaalbedrag is nul. Het bericht wordt als niet verzonden beschouwd en is niet verwerkt in de administratie van de ontvanger. Daarnaast wordt een retourcode meegegeven afhankelijk van de reden van afkeur: &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">a.&nbsp;&nbsp;&nbsp;&nbsp;Het bericht bevat een fout in de header of kan niet worden afgeleverd bij de gemeente: retourcode 0001 (Bericht is afgekeurd om technische reden).&nbsp;<p style=\"margin-top: 3pt;\">b.&nbsp;&nbsp;&nbsp;&nbsp;Het factuurnummer is niet uniek: de retourcode 0030 (Factuurnummer moet uniek zijn voor de verzendende partij) wordt teruggegeven.&nbsp;<p style=\"margin-top: 3pt;\">c.&nbsp;&nbsp;&nbsp;&nbsp;Er is een declaratie ingediend terwijl een factuur werd verwacht of andersom: de retourcode 8855 resp. 8856 wordt teruggegeven.&nbsp;<p style=\"margin-top: 3pt;\">NB: Indien het volledige factuurbericht is afgekeurd dient er geen creditnota te worden verstuurd. (zie ook IV053).&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">3.&nbsp;&nbsp;&nbsp;&nbsp;Het bericht is gedeeltelijk afgekeurd:&nbsp;<p style=\"margin-top: 3pt;\">De header wordt retour gestuurd met retourcode 0200 (Geen opmerking over deze berichtklasse) en het uiteindelijk toegekende totaalbedrag. Indien een fout is geconstateerd in de Clientklasse, wordt de betreffende retourcode bij de Client gevuld en worden alle onderliggende prestaties afgewezen met retourcode 0233 (Berichtklasse is niet beoordeeld). Indien een ingediende Prestatie wordt afgewezen of (in geval van declareren) deels wordt toegekend, wordt deze Prestatie retour gezonden. Hierbij wordt tevens de bijbehorende klasse Client meegestuurd met retourcode 0200 (Geen opmerking over deze berichtklasse). De vulling van de retour gezonden Prestaties is afhankelijk van onderstaande situaties:&nbsp;<p style=\"margin-top: 3pt;\">a.&nbsp;&nbsp;&nbsp;&nbsp;Prestatie is afgewezen: &#233;&#233;n of meerdere retourcodes worden gevuld om de inhoudelijke reden van afwijzing aan te geven. GemeenteBerekendBedrag en ToegekendBedrag worden gevuld met 0 (nul). &nbsp;<p style=\"margin-top: 3pt;\">b.&nbsp;&nbsp;&nbsp;&nbsp;Bij een declaratie kan het voorkomen dat op de Prestatie een afwijkend bedrag is toegekend: GemeenteBerekendBedrag en ToegekendBedrag worden gevuld met het afwijkende bedrag dat de gemeente toekent op deze Prestatie. Let op: dit is niet toegestaan bij factureren! De retourcode hoeft niet gevuld te worden.&nbsp;<p style=\"margin-top: 3pt;\">NB: Prestaties waarvan het ingediende bedrag volledig wordt toegekend, worden niet opgenomen in het retourbericht. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Het retourbericht op een declaratie- of factuurbericht dient niet: &nbsp;<p style=\"margin-top: 3pt;\"></li><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Als ontvangstbevestiging. &nbsp;</li><li>Voor het opvragen van (extra) informatie door de gemeente. </li><li>Voor het doorgeven van correcties op factuurgegevens aan de aanbieder.</li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO304","id":27964,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW304","id":28431,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV056"}}}]
}
]
}
