"name":"TR362: Als een toewijzingsbericht niet wordt gestuurd naar aanleiding van het honoreren van een verzoek om toewijzing of een verzoek om wijziging dan wordt ReferentieAanbieder leeg gelaten.",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Alleen als een toewijzing wordt gestuurd als honorering van een verzoek, dan wordt ReferentieAanbieder overgenomen uit het verzoek.&nbsp;<p style=\"margin-top: 3pt;\"> Als een toewijzing wordt gestuurd &nbsp;op initiatief van de gemeente wordt ReferentieAanbieder niet gevuld.&nbsp;<p style=\"margin-top: 3pt;\">Voorbeeld: na een verzoek om toewijzing wordt een toewijzing gestuurd, deze bevat dan ReferentieAanbieder. Na verloop van tijd stuurt de gemeenten op haar initiatief een gewijzigde toewijzing, bijvoorbeeld met een Einddatum ingevuld. Deze gewijzigde toewijzing heeft dan geen ReferentieAanbieder omdat het geen honorering van een verzoek is.&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO301","id":29618,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW301","id":29203,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_Retourcode-Wmo/Jw","id":30598,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR362"}}}]
