"28791" : {
"id":28791,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV054: Hoe moet een credit prestatie gevuld worden in een declaratie- of factuurbericht?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 9pt;\">In de IngediendeBedragregel van een Prestatie wordt met DebetCredit aangegeven of de indienende partij een vordering (debet) of een terugvordering (credit) doet bij de ontvanger van de nota. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Crediteren declaratie of factuur:</b>&nbsp;<p style=\"margin-top: 3pt;\">Een credit prestatie is identiek aan de oorspronkelijke debet prestatie, met uitzondering van:&nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>ReferentieNummer: de credit prestatie krijgt een nieuw referentienummer.</li><li>VorigReferentieNummer wordt gevuld met het ReferentieNummer van de oorspronkelijke debet prestatie;</li><li>DeclaratieFactuurBedrag:</ul> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* DebetCredit wordt gevuld met &quot;C&quot; (Credit)&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* Vulling van Bedrag is afhankelijk van of het een declaratie of een factuur betreft, zie onder.&nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Crediteren declaratie </b>(alleen mogelijk na ontvangst van het retourbericht, zie IV053):&nbsp;<p style=\"margin-top: 3pt;\"></li><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Indien er een retourbericht is ontvangen met een afwijkend toegekend bedrag, wordt Bedrag gevuld met het toegekende bedrag van de betreffende debet prestatie in het retourbericht.</li><li>Indien het bedrag volledig is toegekend, wordt Bedrag gevuld met het ingediende bedrag van de betreffende debet prestatie in het heenbericht.</ul><b>&nbsp;<p style=\"margin-top: 3pt;\">Crediteren factuur:</b>&nbsp;<p style=\"margin-top: 3pt;\"></li><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Bedrag wordt altijd gevuld met het ingediende bedrag van de betreffende debet prestatie in het heenbericht, ongeacht of er wel of geen retourbericht ontvangen is.</ul>&nbsp;<p style=\"margin-top: 3pt;\">NB: Een gedeeltelijke creditering van een ingediend bedrag, of in geval van declaratie een toegekend bedrag, is niet mogelijk.&nbsp;<p style=\"margin-top: 3pt;\"></li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO303","id":28222,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW303","id":29743,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV054"}}}]
}
]
}
