"28941" : {
"id":28941,
"typeIconPath":"data/icons/ArchiMate/MotivationConstraint.png",
"data" : [
{
"lang":"nl",
"name":"TR342: Alle afgewezen Prestaties dienen meegestuurd te worden in het declaratie-antwoordbericht op een declaratie.",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 11pt;\">Indien afkeur op berichtklasse DeclaratieAntwoord plaatsvindt, dan vindt er geen beoordeling plaats van de prestaties. Deze worden niet opgenomen in het antwoordbericht en daardoor is het niet mogelijk om hiervan de som te bepalen. In deze situatie dient het TotaalToegekendbedrag gevuld te worden met 0. Indien berichtklasse DeclaratieAntwoord geen afkeur bevat, geldt onderstaande.Wanneer niet alle prestaties van een ingediende declaratiebericht zijn goedgekeurd, is er in het declaratie-antwoordbericht een verschil tussen het TotaalIngediendBedrag van de declaratie en het TotaalToegekendBedrag in het declaratie-antwoordbericht. Dit verschil dient verklaard te kunnen worden uit de meegestuurde afgewezen prestaties. </span><span style=\" font-size: 11pt;\">&nbsp;<p style=\"margin-top: 3pt;\"> De volgende controle dwingt dit af: SOM (Prestatie.IngediendBedrag) &nbsp;&nbsp;=DeclaratieAntwoord.TotaalIngediendBedrag -/-TotaalToegekendbedrag<b> &nbsp;<p style=\"margin-top: 3pt;\"></b><span style=\" font-family: Calibri;\"></span><span style=\" font-size: 9pt; font-family: Calibri;\">&nbsp;<p style=\"margin-top: 3pt;\"><span style=\" font-family: Arial;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO325","id":28732,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW325","id":29539,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_Retourcode-Wmo/Jw","id":30598,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR342","niveau":"standaard"}}}]
}
]
}
