"28236" : {
"id":28236,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV060: Hoe moet worden omgegaan met de Eenheid in de ingediende Prestatie indien deze afwijkt van de afgesproken tariefeenheid in het contract?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Indien gemeente en aanbieder een tariefeenheid hebben afgesproken die afwijkt van de Eenheid in de Prestatie, dan moet in de Prestatie het tarief per Eenheid worden omgerekend en afgerond op 2 decimalen. De regels hiervoor staan weergegeven in onderstaande tabel. De afronding vindt plaats op het niveau van Eenheid in de Prestatie. Dus indien een tarief per uur is afgesproken, maar per minuut moet worden gedeclareerd, wordt als eerste het tarief per minuut berekend en afgerond volgens de regels die hier staan beschreven. Dit (afgeronde) tarief wordt in de Prestatie opgenomen en gebruikt om BerekendBedrag te vullen.&nbsp;<p style=\"margin-top: 3pt;\">Afronden gebeurt op basis van de 3e positie achter de komma. Dit betekent dat 1,455 wordt afgerond naar 1,46 en dat 1,454 wordt afgerond naar 1,45.</span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"CDT_IngediendeBedragPrestatie","id":30584,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV060"}}}]
}
]
}
,
"28253" : {
"id":28253,
"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP065: Een retourbericht bevat alleen informatie over clienten waarvan berichtklassen zijn afgekeurd of, bij een declaratiebericht, gedeeltelijk goedgekeurd.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Clienten waarvan alle berichtklassen volledig zijn goedgekeurd worden dus niet mee teruggestuurd in het retourbericht. Het retourbericht bevat alleen clienten waarvan in &#233;&#233;n of meer berichtklassen, over of behorend bij die client, fouten zijn geconstateerd of waarvan, in het geval van het declaratie-/factuurbericht, het ingediende bedrag niet (volledig) wordt toegekend. In dat geval wordt de berichtklasse Client inclusief alle onderliggende berichtklassen retour gezonden, voorzien van retourcodes.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO304","id":27964,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW304","id":28431,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP065","geen technische regels":false}}}]
}
]
}
