"28298" : {
"id":28298,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV091: Hoe moet een creditprestatie gevuld worden in een declaratiebericht?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">In de IngediendBedrag-regel van een Prestatie wordt met DebetCredit aangegeven of de indienende partij een vordering (debet) of een terugvordering (credit) doet bij de ontvanger van de declaratie.&nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Crediteren declaratie:</b> &nbsp;<p style=\"margin-top: 3pt;\">Een creditprestatie is identiek aan de oorspronkelijke debetprestatie, met uitzondering van:&nbsp;<p style=\"margin-top: 3pt;\">* ReferentieNummer: de creditprestatie krijgt een nieuw ReferentieNummer.&nbsp;<p style=\"margin-top: 3pt;\">* VorigReferentieNummer wordt gevuld met het ReferentieNummer van de oorspronkelijke debetprestatie.&nbsp;<p style=\"margin-top: 3pt;\">* DebetCredit in IngediendBedrag wordt gevuld met &quot;C&quot; (Credit)&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Crediteren is alleen mogelijk na ontvangst van het declaratie-antwoordbericht waarin de te crediteren prestatie is toegekend, zie IV085).&nbsp;<p style=\"margin-top: 3pt;\"><span style=\" font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO323","id":28554,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW323","id":29834,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV091"}}}]
}
]
}
