"29557" : {
"id":29557,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV062: Hoe moet ProductPeriode gevuld worden wanneer methode \"werkelijke productperiodes\" gebruikt wordt?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Voor ononderbroken inspanning- of outputgerichte hulp volgt &#233;&#233;n Prestatie per declaratie-/factuurperiode. Er is in dit geval sprake van slechts &#233;&#233;n hulpperiode.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Voor onderbroken inspanning- of outputgerichte hulp volgen meerdere Prestaties per declaratie-/factuurperiode. Er is in dit geval sprake van meerdere hulpperiodes.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De ProductPeriode BeginDatum en de ProductPeriode EindDatum worden gevuld met de datum waarop het product voor het eerst en voor het laatst daadwerkelijk is geleverd. Het is gelijk aan de begin- en einddatum van dat deel van de hulpperiode dat binnen de declaratie-/factuurperiode ligt. Wanneer de gehele hulpperiode binnen de declaratie-/factuurperiode ligt, worden de werkelijke begin- en einddatum van de levering van de hulp gehanteerd als begin- en einddatum product.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Als het resultaat van een hulpperiode voor een outputgericht product pas aan het eind van die hulpperiode kan worden vastgesteld, zijn begindatum product en einddatum product aan elkaar gelijk en worden die op de laatste dag van de hulpperiode gesteld (&#233;&#233;n product in &#233;&#233;n Prestatie).&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Facturatie/Declaratie systematiek&nbsp;<p style=\"margin-top: 3pt;\"></b>Gemeenten en aanbieders kunnen (op grond van OP264) onderling afwijkende afspraken maken over de momenten waarop, al dan niet in delen, gedeclareerd of gefactureerd kan worden, in de situatie van een outputgericht product dat in euro's is toegewezen.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Voorbeelden</b>&nbsp;<p style=\"margin-top: 3pt;\">In onderstaande voorbeelden wordt uitgegaan van de volgende situatie:&nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Er wordt per maand gedeclareerd/gefactureerd</li><li>Het ToegewezenProduct heeft Ingangsdatum 11-04-2019 en Einddatum 18-06-2019 (dit is de toegewezen periode)</li><li>In de voorbeelden staan de ProductPeriodes in de declaratie/factuur voor de maanden April, Mei en Juni benoemd</ul>&nbsp;<p style=\"margin-top: 3pt;\">1: Ononderbroken hulpperiode&nbsp;<p style=\"margin-top: 3pt;\">Client ontvangt vanaf het begin t/m het eind van de toegewezen periode ononderbroken hulp. Er volgt per maand &#233;&#233;n Prestatie met de volgende ProductPeriodes:&nbsp;<p style=\"margin-top: 3pt;\">April: 11-04-2019 t/m 30-04-2019&nbsp;<p style=\"margin-top: 3pt;\">Mei: 01-05-2019 t/m 31-05-2019&nbsp;<p style=\"margin-top: 3pt;\">Juni: 01-06-2019 t/m 18-06-2019&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">2: Onderbroken hulpperiode&nbsp;<p style=\"margin-top: 3pt;\">Client ontvangt onderbroken hulp in de volgende periodes:&nbsp;<p style=\"margin-top: 3pt;\">- 12-04-2019 t/m 15-04-2019&nbsp;<p style=\"margin-top: 3pt;\">- 23-04-2019 t/m 08-05-2019&nbsp;<p style=\"margin-top: 3pt;\">- 13-05-2019 t/m 20-05-2019&nbsp;<p style=\"margin-top: 3pt;\">- 03-06-2019 t/m 07-06-2019&nbsp;<p style=\"margin-top: 3pt;\">- 11-06-2019 t/m 17-06-2019&nbsp;<p style=\"margin-top: 3pt;\">Er volgen per maand meerdere Prestaties met de volgende ProductPeriodes:&nbsp;<p style=\"margin-top: 3pt;\">April: 12-04-2019 t/m 15-04-2019 en 23-04-2019 t/m 30-04-2019&nbsp;<p style=\"margin-top: 3pt;\">Mei: 01-05-2019 t/m 08-05-2019 en 13-05-2019 t/m 20-05-2019&nbsp;<p style=\"margin-top: 3pt;\">Juni: 03-06-2019 t/m 07-06-2019 en 11-06-2019 t/m 17-06-2019&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">3: Outputgericht met resultaat op eind van hulpperiode&nbsp;<p style=\"margin-top: 3pt;\">Client ontvangt onderbroken of ononderbroken outputgerichte hulp vanaf het begin tot het eind van toegewezen periode (11-04-2019 t/m 18-06-2019). Pas op 18-06-2019 kan het resultaat van de outputgerichte hulp worden vastgesteld. In de maanden April en Mei wordt er geen declaratie/factuur ingediend voor deze client. Er volgt in de maand juni &#233;&#233;n Prestatie met de volgende ProductPeriode:&nbsp;<p style=\"margin-top: 3pt;\">Juni: 18-06-2019 t/m 18-06-2019 &nbsp;<p style=\"margin-top: 3pt;\"><span style=\" font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span></li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO303","id":28222,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW303","id":29743,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV062"}}}]
}
]
}
