"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 9pt;\">Bij een volledige toekenning zal het ingediende bedrag in de som van de door de gemeente toegekende bedragen in de header van het factuurretourbericht worden meegenomen.&nbsp;<p style=\"margin-top: 3pt;\">Bij een volledige afwijzing zal het toegekende bedrag in het factuurretourbericht gelijk zijn aan 0 (nul).<span style=\" font-family: Arial;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO304","id":27964,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW304","id":28431,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP287"}}}]
