"29171" : {
"id":29171,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV076: Hoe wordt de juiste productperiode bepaald wanneer de toewijzing de frequentie week heeft?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De productperiode binnen een declaratieperiode is altijd maximaal een kalendermaand. Als ToegewezenProduct de frequentie per week heeft, is het mogelijk dat de week verdeeld is over meerdere productperiodes (kalendermaanden). Bijvoorbeeld wanneer halverwege een week een nieuwe maand begint. De datum van levering bepaalt in welke productperiode de leveringen worden ingediend. Voor het bepalen van de juiste productperiode zijn er twee methoden (voor inspanningsgerichte toewijzing en voor outputgerichte toewijzing).&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Methode bij Inspanningsgerichte toewijzing&nbsp;<p style=\"margin-top: 3pt;\"></b>De productperiode bevat alleen leveringen van dagen die vallen in de betreffende kalendermaand.&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">Voorbeeld:&nbsp;<p style=\"margin-top: 3pt;\">Levering week 13-2021 = maandag 29-03-2021 t/m zondag 04-04-2021&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Deze levering valt uiteen in 2 productperiodes. &nbsp;<p style=\"margin-top: 3pt;\">* productperiode 1, waarin de levering zit van week 13 tot maximaal 31-03-2021,&nbsp;<p style=\"margin-top: 3pt;\">* productperiode 2, waarin de levering zit van week 13 vanaf 01-04-2021.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Afhankelijk van het moment van declareren, zullen de periodes in 1 of meerdere declaratieberichten zitten.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Methode bij Outputgerichte toewijzing&nbsp;<p style=\"margin-top: 3pt;\"></b>De productperiode bevat leveringen van de week waarvan de zondag valt in de kalendermaand &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Voorbeeld:<u>&nbsp;<p style=\"margin-top: 3pt;\"></u>Levering week 13-2021 = maandag 29-03-2021 t/m zondag 04-04-2021&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De zondag van week 13 valt op 04-04-2021, dus de levering van week 13 valt in kalendermaand April. Alle leveringen van week 13 worden opgenomen in de kalendermaand April.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO323","id":28554,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW323","id":29834,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV076"}}}]
}
]
}
,
