"29444" : {
"id":29444,
"typeIconPath":"data/icons/ArchiMate/BusinessProcess.png",
"data" : [
{
"lang":"nl",
"name":"Verzoek om toewijzing",
"type":"Bedrijfsproces",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 9pt;\">De aanbieder verzoekt de gemeente om een toewijzing te sturen voor het leveren van jeugdhulp waarvoor reeds een titel tot levering bestaat.&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">Het Verzoek om toewijzing bericht kan alleen gebruikt worden voor situaties waarbij het recht op jeugdhulp al vaststaat en is daarmee &#233;&#233;n van de rechtmatigheidsberichten. Met het Verzoek om toewijzing geeft de aanbieder aan hij de zorg wil opstarten. De gemeente stuurt altijd binnen drie werkdagen een retourbericht om aan te geven dat het Verzoek om toewijzing ontvangen is. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De gemeente die het Verzoek om toewijzing ontvangt is verplicht om te toetsen of, op basis van het woonplaatsbeginsel, de cli&#235;nt onder haar verantwoordelijkheid valt. Wanneer dat zo is, stuurt de gemeente de aanbieder een offici&#235;le toewijzing voor de te leveren jeugdhulp. &nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Verzoek om toewijzing afwijzen</b>&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><span style=\" font-family: Arial;\">Wanneer volgens het woonplaatsbeginsel een andere gemeente verantwoordelijk is voor de cli&#235;nt, vindt een overdracht plaats. De gemeente die het Verzoek om toewijzing ontvangen heeft, beantwoord het verzoek om toewijzing met een antwoordbericht met reden &quot;woonplaatsbeginsel&quot;, waarin de juiste gemeente gecommuniceerd kan worden. De aanbieder verstuurt vervolgens het Verzoek om toewijzing aan de verantwoordelijke gemeente. &nbsp;<p style=\"margin-top: 3pt;\">De gemeente die de aanvraag ontvangt is verantwoordelijk voor de cli&#235;nt, tot het moment dat de cli&#235;nt is overgedragen aan de gemeente die volgens het woonplaatsbeginsel verantwoordelijk is voor de cli&#235;nt. &nbsp;<p style=\"margin-top: 3pt;\">Wanneer de gemeente vaststelt dat het verzoek onterecht is omdat er een ongewenste samenloop met een ander lopend zorgtraject is, kan dit ook via het antwoordbericht gecommuniceerd worden. Wanneer de gemeente vaststelt dat het verzoek onterecht is omdat het niet aansluit bij de contractafspraken, wordt de betreffende reden gemeld in het antwoordbericht, als antwoord op het verzoek. De aanbieder kan daarna een gewijzigd verzoek om toewijzing verzenden.&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-family: Arial;\"><b></span>Verzoek om toewijzing corrigeren&nbsp;<p style=\"margin-top: 3pt;\"></b>Wanneer de aanbieder vaststelt dat er een verkeerde toewijzing is aangevraagd, bijvoorbeeld doordat een verkeerd product is opgenomen, neemt de aanbieder buiten het berichtenverkeer om contact op met de gemeente. Na afstemming met de gemeente kan vervolgens een nieuw Verzoek om toewijzing bericht verzonden worden. &nbsp;<p style=\"margin-top: 3pt;\">Het Verzoek om toewijzing bericht &nbsp;bevat clientgegevens en gegevens over de producten waarvoor de toewijzing wordt aangevraagd. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">"}}]
}
]
}
