"29967" : {
"id":29967,
"typeIconPath":"data/icons/ArchiMate/BusinessProcess.png",
"data" : [
{
"lang":"nl",
"name":"Verzoek om toewijzing",
"type":"Bedrijfsproces",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De aanbieder verzoekt de gemeente om een toewijzing te sturen voor het leveren van Wmo-ondersteuning waarvoor reeds een titel tot levering bestaat.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Het Verzoek om toewijzing bericht kan alleen gebruikt worden voor situaties waarbij het recht op zorg of ondersteuning al vaststaat en is daarmee &#233;&#233;n van de rechtmatigheidsberichten. Met het Verzoek om toewijzing geeft de aanbieder aan dat het contact met de client is gelegd en dat er een toewijzing moet volgen. De gemeente stuurt altijd binnen drie werkdagen een retourbericht om aan te geven dat het Verzoek om toewijzing ontvangen is.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De gemeente die het Verzoek om toewijzing ontvangt controleert deze en stuurt vervolgens de aanbieder een officiele toewijzing voor de te leveren Wmo-ondersteuning. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Verzoek om toewijzing afwijzen&nbsp;<p style=\"margin-top: 3pt;\"></b>Wanneer de gemeente vaststelt dat het verzoek onterecht is omdat het niet aansluit bij de contractafspraken, wordt de betreffende reden gemeld met een retourcode en wordt een retourbericht gestuurd als antwoord op het verzoek. &nbsp;<p style=\"margin-top: 3pt;\">Wanneer de gemeente vaststelt dat het verzoek onterecht is omdat de gemeente niet verantwoordelijk is voor de client, of omdat er een ongewenste samenloop is met een ander lopend zorgtraject, neemt de gemeente buiten het berichtenverkeer om contact op met de aanbieder om de afwijzing te melden.&nbsp;<p style=\"margin-top: 3pt;\">De aanbieder kan daarna een nieuw verzoek om toewijzing verzenden.&nbsp;<p style=\"margin-top: 3pt;\"><b>Verzoek om toewijzing corrigeren&nbsp;<p style=\"margin-top: 3pt;\"></b>Wanneer de aanbieder vaststelt dat er een verkeerde toewijzing is aangevraagd, bijvoorbeeld doordat een verkeerd product is opgenomen, neemt de aanbieder buiten het berichtenverkeer om contact op met de gemeente. Na afstemming met de gemeente kan vervolgens een nieuw verzoek om toewijzing bericht verzonden worden.&nbsp;<p style=\"margin-top: 3pt;\">Het Verzoek om toewijzing bericht bevat clientgegevens en gegevens over de producten waarvoor de toewijzing wordt aangevraagd. <span style=\" font-family: Arial;\"></span><span style=\" font-size: 9pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
