"31442" : {
"id":31442,
"typeIconPath":"data/icons/ArchiMate/BusinessProcess.png",
"data" : [
{
"lang":"nl",
"name":"Intrekken Jeugdhulp",
"type":"Bedrijfsproces",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De gemeente kan een eerder afgegeven toewijzing intrekken, daarmee wordt de opdracht tot levering van een jeugdhulpproduct voor een specifieke cli&#235;nt voor die aanbieder be&#235;indigd. De intrekking bevat dezelfde gegevens als de toewijzing, maar nu met de einddatum ingevuld of met een einddatum die ligt v&#243;&#243;r de einddatum van de eerder verzonden toewijzing. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De gemeente kan een toewijzing bijvoorbeeld intrekken wanneer bij een nieuwe beoordeling wordt vastgesteld dat een cli&#235;nt de eerder toegewezen jeugdhulp niet meer nodig heeft. De toewijzing krijgt dan een (nieuwe) einddatum. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Ook kan het voorkomen dat de client de jeugdhulp bij een andere aanbieder gaat voortzetten. Dan krijgt alleen de toewijzing (toegewezen product) een (nieuwe) einddatum.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Behalve de wijziging zelf (nieuwe einddatum) wordt ook meegegeven wat de reden van de wijziging is. Hiervoor is een speciale tabel beschikbaar waaruit de reden gekozen kan worden (codelijst Reden wijziging toewijzing JZ002). De redenen van wijziging zijn hieronder nader toegelicht. Zie voor meer informatie de casuistiek. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Administratieve correctie &nbsp;<p style=\"margin-top: 3pt;\"></b>Gemeente ontdekt dat de toewijzing foutief was en gecorrigeerd moet worden. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Client overleden &nbsp;<p style=\"margin-top: 3pt;\"></b>De toewijzing moet worden gestopt, omdat de client is overleden. &nbsp;<p style=\"margin-top: 3pt;\">Over het algemeen zal dan worden gevuld: einddatum toewijzing = overlijdensdatum client. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Contractwijziging &nbsp;<p style=\"margin-top: 3pt;\"></b>Gemeente maakt een nieuwe contractafspraak met aanbieder, waardoor toewijzing nodig is met ander bijvoorbeeld andere productcodes. NB: niet elke contractwijziging zal leiden tot een nieuwe toewijzing. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Herbeoordeling: verlenging toewijzing&nbsp;<p style=\"margin-top: 3pt;\"></b>Als gevolg van een herbeoordeling kan een toewijzing verlengd worden. Als de zorg verlengd wordt, dan kan eventueel gebruik gemaakt worden van dezelfde toewijzing.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Herbeoordeling: verkorting toewijzing&nbsp;<p style=\"margin-top: 3pt;\"></b>In verschillende situaties zal de huidige toewijzing ingetrokken moeten worden: &nbsp;<p style=\"margin-top: 3pt;\">* Client moet ander product toegewezen krijgen. &nbsp;<p style=\"margin-top: 3pt;\">* Client moet korter zorg krijgen. &nbsp;<p style=\"margin-top: 3pt;\">* Client moet andere omvang krijgen, bijvoorbeeld meer uren per week, tenzij het een toewijzing in budget of totaal per toewijzing periode betreft&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Uitstroom naar ander domein &nbsp;<p style=\"margin-top: 3pt;\"></b>Client gaat over naar ander domein, bijvoorbeeld naar Wlz, en daarom eindigt de Jw toewijzing. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Verhuizing naar een andere gemeente &nbsp;<p style=\"margin-top: 3pt;\"></b>De gemeente kan een afgegeven Toewijzing niet zomaar intrekken bij verhuizing naar een andere gemeente. De gemeente die de toewijzing heeft verstrekt, blijft verantwoordelijk voor de cli&#235;nt tot het moment dat de cli&#235;nt is overgedragen aan de gemeente die volgens het woonplaatsbeginsel verantwoordelijk is voor de cli&#235;nt. Dit betekent dat een toewijzing door de oude gemeente niet kan worden afgesloten voordat er zekerheid is dat de nieuwe gemeente een aansluitende toewijzing verzendt. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Wijziging leveringsvorm &nbsp;<p style=\"margin-top: 3pt;\"></b>Client gaat gebruik maken van pgb. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Overstap naar andere aanbieder &nbsp;<p style=\"margin-top: 3pt;\"></b>Client gaat naar een andere aanbieder, dus de toewijzing bij deze aanbieder moet beeindigd worden. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Overgang naar nieuwe bekostigingssystematiek &nbsp;<p style=\"margin-top: 3pt;\"></b>De toewijzing is ingetrokken, omdat de client is overgegaan naar een andere regeling/bekostiging. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Gemeentelijke herindeling &nbsp;<p style=\"margin-top: 3pt;\"></b>Volgens protocol gemeentelijke herindeling is deze toewijzing niet meer geldig.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Geinitieerd door de aanbieder&nbsp;<p style=\"margin-top: 3pt;\"></b>Indien een toewijzing wijzigt als gevolg van een verzoek om wijziging, kan dit door de gemeente worden aangegeven middels deze code. Het is dan voor de aanbieder duidelijk op basis waarvan de wijziging is doorgevoerd. &nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
