"40192" : {
"id":40192,
"typeIconPath":"data/icons/ArchiMate/BusinessRole.png",
"data" : [
{
"lang":"nl",
"name":"Gemeente",
"type":"Bedrijfsrol",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De gemeente is volgens de WMO 2015 verantwoordelijk voor de ondersteuning van mensen die niet op eigen kracht zelfredzaam zijn. De gemeente zorgt ervoor dat burgers die ondersteuning aanvragen beoordeeld worden en worden toegeleid naar een Wmo aanbieder die de juiste ondersteuning kan leveren.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Volgens de Jeugdwet is de gemeente verantwoordelijk voor alle vormen van jeugdhulp (inclusief specialistische hulp zoals jeugd-ggz, jeugd-vb, gesloten jeugdhulp, en het onderdeel 'preventie' van de jeugdgezondheidszorg). Ook is de gemeente binnen het jeugdstelsel verantwoordelijk voor de uitvoering van kinderbeschermingsmaatregelen en jeugdreclassering. &nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
