,
"40189" : {
"id":40189,
"typeIconPath":"data/icons/ArchiMate/BusinessRole.png",
"data" : [
{
"lang":"nl",
"name":"CIZ",
"type":"Bedrijfsrol",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Iemand die Wlz-zorg nodig heeft (de client), meldt zich bij het indicatieorgaan in de regio waarin hij woont. Het CIZ vervult de functie van indicatieorgaan. Het CIZ beoordeelt op basis van de zorgbehoefte van de client of deze in aanmerking komt voor Wlz-zorg en controleert tevens bij de SVB of de client recht heeft op Wlz zorg. Zo ja, dan ontvangt de client een indicatiebesluit waarin vermeld staat op welke zorg de client recht heeft. Het CIZ heeft ook de taak na te gaan wat de voorkeuraanbieder is van de client en welke leveringsvorm zijn voorkeur heeft (ZIN, PGB, VPT). Het CIZ kan andere organisaties of deskundigen inschakelen bij de indicatiestelling, maar blijft wel eindverantwoordelijk voor (de kwaliteit van) de indicatiebesluiten. Het CIZ stuurt het indicatiebesluit in de vorm van een iStandaarden bericht (IO31) naar het zorgkantoor.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
