"lang":"nl",
"name":"Beoordelen",
"type":"Bedrijfsactiviteit",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De gemeente, of bijvoorbeeld een sociaal wijkteam namens de gemeente, beoordeelt welke jeugdhulp een cli&#235;nt nodig heeft, hoeveel jeugdhulp (omvang) en hoe lang (voor welke periode). &nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
