"typeIconPath":"data/icons/ArchiMate/BusinessActivity.png",
"data" : [
{
"lang":"nl",
"name":"Controleren woonplaatsbeginsel",
"type":"Bedrijfsactiviteit",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Na het ontvangen van het Verzoek om toewijzing toetst de gemeente op basis van het woonplaatsbeginsel of de client onder haar verantwoordelijkheid valt. &nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
