,
"51227" : {
"id":51227,
"typeIconPath":"data/icons/ArchiMate/BusinessRole.png",
"data" : [
{
"lang":"nl",
"name":"Zorgaanbieder",
"type":"Bedrijfsrol",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De zorgaanbieder levert de zorg en houdt daarbij rekening met de ontvangen zorgtoewijzing en contractafspraken met het zorgkantoor. De zorgaanbieder meldt de start van de zorg en de beeindiging daarvan aan het zorgkantoor. Ook meldt de zorgaanbieder wijzigingen in de zorglevering en wijzigingen in de leveringsstatus aan het zorgkantoor. Een speciale rol is weggelegd voor de dossierhouder, de voorkeuraanbieder van de client die een indicatie heeft voor verblijf. De dossierhouder onderhoudt het contact met de client en het zorgkantoor en is verantwoordelijk voor het regelen van overbruggingszorg. De dossierhouder is de schakel tussen de aanbieder die de overbruggingszorg levert en het zorgkantoor.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
